  "GetApps": "Dapatkan Aplikasi",
  "GetAppsInstruction": "Berikan tautan di bawah ini kepada orang lain, atau arahkan mereka ke Aplikasi > Dapatkan aplikasi di layanan Power BI.",
  "GetDataAnalysisServices": "Analysis Services",
  "GetDataBlankQuery": "Kueri kosong",
  "GetDataExcel": "Excel",
  "GetDataMenu": "Dapatkan data",
  "GetDataOData": "Umpan OData",
  "GetDataPowerBIDataflows": "Aliran data Power BI",
  "GetDataPowerBIDatasets": "Himpunan data Power BI",
  "GetDataSQLServer": "SQL Server",
  "GetDataSeeMoreOptions": "Lihat opsi selengkapnya",
  "GetDataTextCsv": "Teks/CSV",
  "GetDataWeb": "Web",
  "GetData_ATInternetBridge": "AT Internet Bantuan Anda mengekstrak nilai langsung dari data Anda, berkat platform analitik digital terpadu Analytics Suite. Dengan Power BI Anda dapat memvisualisasikan semua data analisis AT internet Anda dalam dashboard standar dan menyesuaikan pelaporan untuk mendapatkan informasi penting dalam sekejap. Gunakan fitur-fitur Power BI untuk mendalami ke semua kumpulan data dengan mengklik ubin dasbor dan memilih dari beberapa grafik dan opsi grafik untuk analisis data Anda.",
  "GetData_Acumatica": "Menyambungkan ke Acumatica langsung dari Power BI memungkinkan Anda mengakses wawasan bisnis yang sangat lengkap. Masuk ke Power BI menggunakan kredensial Acumatica ERP, dan susun wawasan yang bermanfaat atas alur peluang, peluang dalam berbagai tahap, serta peluang yang berhasil diraih dan tidak. Dasbor yang tidak biasa memberikan serangkaian tampilan yang dapat disesuaikan sepenuhnya. Anda dapat menanyakan pertanyaan tentang data di T&J atau klik ubin untuk membuka laporan yang mendasari dan ubah ubin di dasbor. Acumatica akan terus merilis dasbor tambahan untuk prospek, analisis dukungan, keuangan, dan lainnya.",
  "GetData_AddYourContent": "Tambahkan konten Anda",
  "GetData_AdobeAnalytics": "Adobe Analytics adalah alat analisis web yang menggabungkan data tentang situs web Anda dengan kampanye e-perdagangan yang memungkinkan Anda mengawasi keberhasilannya. Dengan Power BI, Anda dapat menyesuaikan dasbor yang memungkinkan Anda melihat informasi penting secara sekilas. Klik visual untuk menjelajahi lebih dalam ke laporan merinci untuk informasi tertentu.",
  "GetData_AlpineMetrics": "Metrik Alpine menyediakan Optimasi Proses Penjualan Prediktif canggih di cloud, dan permintaan untuk organisasi penjualan besar dan kecil.",
  "GetData_Appfigures": "Hubungkan dan jelajahi data appFigures Anda dalam Power BI. Paket konten appFigures secara otomatis membuat dasbor yang dapat Anda gunakan untuk memantau dan menjelajahi data tentang semua aplikasi Anda dari satu tempat. Untuk setiap aplikasi, Anda dapat melacak jumlah unduhan, termasuk bagaimana dinilai dan negara mana yang menggunakan aplikasi Anda. Anda juga dapat melacak pembelian dalam aplikasi dan klik iklan, agar benar-benar memahami pendapatan dari aplikasi Anda.",
  "GetData_ApplicationInsights": "Lihat pengguna aplikasi web Anda, sesi, dan tayangan halaman Anda di bagan dan peta. Paket ini menyajikan telemetri yang dikumpulkan dari aplikasi Anda oleh Application Insight Visual Studio. Dasbor dan laporan yang memperlihatkan data selama 30 hari terakhir akan ditampilkan.",
  "GetData_AuthenticationError_Title": "Gagal menampilkan dialog autentikasi",
  "GetData_Azme": "Azure Mobile Engagement merupakan alat analisis aplikasi yang membantu Anda memperkirakan keberhasilan aplikasi Anda. Dengan Power BI, Anda dapat menyesuaikan dasbor yang memungkinkan Anda melihat informasi penting dalam sekilas. Klik visual untuk melihat laporan merinci untuk informasi tertentu.",
  "GetData_AzureAuditLogs": "Dapatkan wawasan tentang acara, pemberitahuan, dan log yang tersedia di Log Audit Azure untuk langganan Azure Anda. Paket konten Power BI otomatis membuat laporan dan dasbor untuk langganan Azure Anda untuk membantu Anda langsung menampilkan dan menganalisis data. Anda dapat menyunting dan mengubahsuaikan laporan atau dasbor dan membagikannya kepada organisasi Anda. Data log audit akan otomatis disegarkan sesuai jadwal yang Anda atur.",
  "GetData_AzureEnterprise": "Dengan paket konten Microsoft Azure Enterprise untuk Power BI, Anda dapat mengimpor dan menganalisis konsumsi Azure untuk pendaftaran perusahaan Anda selama 12 bulan terakhir. Temukan departemen, akun, atau langganan mana yang memiliki penggunaan terbesa, layanan mana yang paling banyak digunakan organisasi Anda, atau lacak tren penggunaan dan pembelanjaan. Klik bagan untuk melihat rincian biaya selengkapnya.",
  "GetData_AzureHDInsightSparkLiveConnect": "Apache Spark™ adalah mesin umum dan cepat untuk pemrosesan data skala besar. Azure HDInsight menawarkan layanan Spark yang dikelola penuh untuk kinerja interaktif dan penskalaan interaktif. HDInsight Spark dapat terhubung ke penyimpanan Blob apa pun di Azure Storage atau Azure Data Lake. Dengan konektor Spark on Azure HDInsight untuk Power BI, pengguna dapat mengajukan kueri dan memvisualisasikan volume besar data tidak terstruktur yang telah dimodelkan dalam Spark. Hasilnya adalah eksplorasi data interaktif dan pelaporan di Power BI dengan skala data yang amat besar.",
  "GetData_AzureSearch": "Azure Search memberdayakan Anda untuk membangun pengalaman pencarian hebat untuk aplikasi web dan seluler. Dengan paket konten Power BI, Anda dapat memvisualisasikan bagaimana layanan pencarian Anda bekerja dan apa yang dicari oleh pengguna. Dasbor yang dimuat sebelumnya akan memuat data 30 hari terakhir dan akan memberikan titik awal untuk mengeksplorasi data lalu lintas pencarian Anda dan memungkinkan Anda menjawab pertanyaan seperti kueri pencarian yang paling umum atau latensi pencarian Anda. Anda dapat lebih lanjut menyesuaikan dasbor Anda untuk menyorot data yang paling penting bagi Anda. Analitik Lalu Lintas Pencarian harus diaktifkan untuk layanan pencarian Anda.",
  "GetData_AzureSqlDatabaseWithLiveConnect": "Azure SQL Database merupakan database hubungan yang dikelola penuh sebagai layanan yang menjadikan kapabilitas tingkat-1 mudah diakses. SQL Database mendukung penentuan skala secara besar-besaran, kinerja yang dapat diprediksi, kemampuan manajemen yang fleksibel, serta mencakup ketersediaan bawaan yang tinggi dan manajemen mandiri yang hampir tanpa pemeliharaan. Dengan Power BI, Anda dapat membuat laporan dinamis, memadukan data dan metrik yang telah Anda miliki di Azure SQL Database.",
  "GetData_AzureSqlDatawarehouseLiveConnect": "Dorong wawasan langsung dari data Anda menggunakan skala elastis SQL Data Warehouse dengan sambung langsung. Padukan data hubungan petabyte atau lebih secara lancar dengan data Hadoop non-hubungan menggunakan Polybase untuk tampilan data Anda sepenuhnya. Untuk memulai, cukup klik Sambungkan.",
  "GetData_AzureUsageAndBilling": "Dengan paket konten Penggunaan dan Tagihan Azure, Anda dapat dengan cepat mengimpor dan menganalisa konsumsi untuk langganan Azure Anda selama 3 bulan terakhir. Memvisualisasikan perkiraan belanja untuk layanan yang berjalan dalam berlangganan. Melacak penggunaan dan memahami tren harian penggunaan layanan. Paket konten ini diutamakan untuk langganan non-Perusahaan. Langganan Perusahaan harus menggunakan paket konten Microsoft Azure Enterprise.",
  "GetData_BIProfessional_Title": "Profesional BI",
  "GetData_BigDataAndMore": "Database & Lainnya",
  "GetData_BingAds": "Memvisualisasikan data kinerja Iklan Bing langsung dalam Power BI.<li>Memanfaatkan fitur T&J untuk dengan cepat mengumpulkan wawasan tentang kampanye</li><li>Membangun dasbor khusus dan laporan yang disesuaikan dengan masing-masing KPI Anda </li><li>Paket konten ini meliputi data dari 60 hari terakhir</li>",
  "GetData_BingNews": "Lacak judul berita terbaru di dasbor Anda dengan Bing Berita dan terus dapatkan berita terbaru untuk topik yang paling penting bagi Anda. Masukkan istilah pencarian untuk topik yang ingin dilacak dan tambahkan ubin berita ke dasbor yang saat ini Anda pilih. Mengeklik judul berita yang dicantumkan akan membuka artikel aslinya sehingga Anda dapat membacanya lebih lanjut.",
  "GetData_BingSocial": "Paket konten Bing memberikan analisis menurut permintaan dari aktivitas pencarian Internet dari istilah kueri yang diberikan, misalnya orang, perusahaan, atau topik.",
  "GetData_BrowserPopUpDisabled": "Pop-up browser dinonaktifkan. Verifikasi pengaturan browser.",
  "GetData_BuildOnExistingDatasets_Title": "Buat di himpunan data yang ada",
  "GetData_BusinessAnalyst_Title": "Analis Bisnis",
  "GetData_BusinessUser_Title": "Pengguna Bisnis",
  "GetData_ChooseDataSource": "Pilih sumber data",
  "GetData_CircuitId": "Langkah penting agar komunikasi terpadu berfungsi untuk Anda adalah memiliki kemampuan untuk menaksir dan memahami tren komunikasi bisnis Anda. Paket konten Circuit ID Power BI ini membantu Anda memahami bagaimana cara bisnis berinteraksi dengan pelanggan memungkinkan Anda mengelola situasi yang paling menantang sekalipun.",
  "GetData_Connect": "Sambung",
