  "GetData_ConnectTo": "Sambungkan ke ",
  "GetData_ConnectToPartner": "Hubungkan ke mitra",
  "GetData_ConnectToPartnerBlurb": "Tidak melihat data yang paling Anda perhatikan dalam Power BI? Kami memiliki jaringan global mitra Power BI yang siap membantu. ",
  "GetData_ConnectYourData": "Hubungkan Data Anda",
  "GetData_ContentLibrary_Title": "Temukan konten",
