  "GetData_CreateContentPack_Title": "Buat Paket Konten",
  "GetData_CreateContent_MoreOptions_Title": "Lebih banyak cara untuk membuat konten Anda sendiri",
  "GetData_CustomerProfitabilitySample": "Contoh dasbor dan laporan industri yang mendasari ini menganalisis perusahaan yang memproduksi materi pemasaran. Dasbor ini dibuat oleh CFO untuk melihat metrik kunci tentang 5 manajer unit bisnisnya (para eksekutif), produk, pelanggan, dan margin kotor (GM). Secara sekilas, dia dapat melihat faktor apa yang memengaruhi keuntungan. Ini merupakan data asli dari Obvience obviEnce (www.obvience.com) yang telah dianonimkan.",
  "GetData_CustomerProfitabilitySample_Subtext": "Coba sampel ini untuk mempelajari apa yang dapat dilakukan dengan laporan Power BI.",
