  "GetData_Databases_Desc": "Gunakan Power BI Desktop untuk menyambungkan ke data di Azure SQL Database dan lainnya.",
  "GetData_Dataflows_Desc": "Gabungkan tipe data yang berbeda, tentukan logika ETL, dan siapkan data Anda untuk pemodelan.",
