  "GetData_DownloadDesktop": "Desktop Unduhan",
  "GetData_DownloadDesktopInfo": "Sumber data ini tersedia di Desktop Power BI, yang hanya perlu satu menit untuk memasangnya. Setelah menyambungkan ke sumber data di Desktop, Anda dapat menerbitkan laporan dengan sumber data tersebut ke layanan Power BI. {0}",
  "GetData_FileCannotBeUploadedText": "File yang coba Anda unggah mungkin dibuka oleh aplikasi lain. Tutup semua aplikasi lain sebelum menggunakan file ini dan coba lagi.",
