  "GetData_GetServices": "Layanan, Dapatkan",
  "GetData_GitHub": "Visualkan jenis aktivitas repositori yang berbeda di Power BI dengan menghubungkannya ke data GitHub Anda. Dengan paket konten GitHub, Anda mendapatkan dasbor Power BI dan laporan dengan wawasan tentang berapa banyak komitmen, siapa yang paling berkontribusi, dan pada jam berapa. Gunakan dasbor dan laporan yang diberikan, atau sesuaikan untuk menyoroti informasi yang paling penting bagi Anda.<br/><br/>Data di Power BI diperbarui setiap hari dari GitHub sesuai jadwal yang Anda kendalikan.",
  "GetData_GoogleAnalytics": "Visualkan data dari akun Google Analytics Anda secara langsung ke Power BI. Dapatkan wawasan dari situs yang Anda lacak, misalnya lalu lintas situs selama 30 hari terakhir atau hari ketika situs Anda paling populer. Paket konten ini meliputi data dari 180 hari terakhir. Gunakan laporan yang dibuat oleh Power BI apa adanya, atau sesuaikan untuk metrik yang penting bagi Anda.",
  "GetData_GroupingInstruction": "Pilih paket konten dan terhubung.",
  "GetData_Grouping_MicrosoftDynamicsCRMPSA": "Dynamics CRM Project Services diperluas dari manajemen peluang melalui pengiriman layanan, menyediakan penjualan + eksekusi + dukungan solusi Business SaaS menyeluruh untuk Organisasi Layanan Profesional.  Hubungan antara tenaga penjualan dan operasi ini akan memberikan tampilan 360 derajat secara real time yang tak tertandingi mengenai pelanggan dan pengoperasian. Paket konten Power BI menawarkan solusi analitik untuk beberapa tenaga Project Services seperti yang dijelaskan di bawah ini.",
  "GetData_HelpfulLinks": "Jelajahi opsi lain:",
  "GetData_HideDetails": "Sembunyikan detail.",
  "GetData_HumanResourcesSample": "Contoh dasbor dan laporan industri yang mendasari ini menganalisis informasi HR. Departemen HR memiliki model pelaporan yang sama di berbagai perusahaan, bahkan saat industri atau ukurannya berbeda. Contoh ini melihat pengangkatan karyawan baru, karyawan aktif, dan karyawan yang keluar serta mencoba untuk menemukan tren dalam strategi pengangkatan karyawan. Tujuan utama kami adalah memahami siapa yang kami angkat sebagai karyawan, bias dalam strategi pengangkatan karyawan, dan tren dalam pemisahan sukarela. Ini adalah data asli dari obviEnce (www.obvience.com) yang telah dianonimkan.",
  "GetData_HumanResourcesSample_Title": "Sampel Sumber Daya Manusia",
  "GetData_ITSpendAnalysisSample": "Contoh dasbor dan laporan industri yang mendasari ini menganalisis rencana biaya vs biaya aktual departemen TI perusahaan. Perbandingan ini membantu kita memahami seberapa baik rencana perusahaan dalam setahun dan memungkinkan kita menginvestigasi area dengan penyimpangan besar dari rencana. Perusahaan dalam contoh ini melalui siklus perencanaan tahunan, lalu membuat Perkiraan Terbaru (LE) setiap tiga bulan untuk membantu menganalisis perubahan dalam pengeluaran TI selama tahun fiskal. Ini adalah data asli dari obviEnce (www.obvience.com) yang telah dianonimkan.",
  "GetData_ITSpendAnalysisSample_Subtext": "Coba menganalisis data departemen TI sampel.",
  "GetData_ITSpendAnalysisSample_Title": "Sampel Analisis Biaya TI",
  "GetData_Import": "Impor",
  "GetData_ImportingFile": "Mengimpor {0}",
  "GetData_Insightly": "Mengelola bisnis Anda secara lebih efisien dengan Insightly CRM. Dapatkan pemahaman yang lebih baik mengenai data CRM Anda dengan paket konten Insightly untuk Power BI. Sambungkan menggunakan kunci API Insightly Anda untuk melihat metrik kunci pada peluang penjualan, kontak, organisasi, proyek, tugas, dan acara. Anda akan mulai dengan dasbor visual dan laporan saluran penjualan, penampil teratas, laporan corong, memetakan geografis, dan banyak lagi. Gunakan dasbor dan laporan yang disediakan, atau sesuaikan oleh Anda sendiri untuk menjelajahi informasi paling penting bagi Anda.",
  "GetData_LearnMoreAboutDesktop": "Pelajari tentang Desktop Power BI",
  "GetData_LearnToAddData": "Pelajari untuk menambahkan data",
  "GetData_LearnToAddTileCategoryDescription": "Pilih peran Anda di dalam organisasi untuk mempelajari lebih lanjut tentang menghubungkan data Anda ke Power BI.",
  "GetData_Lithium": "Lithium membangun hubungan tepercaya antara merek terbaik di dunia dan pelanggan mereka, sehingga membantu pengguna mendapatkan jawaban dan berbagi pengalaman mereka. Dengan menghubungkan paket konten Lithium ke Power BI, Anda dapat mengukur metrik penting tentang komunitas online Anda untuk membantu mendorong penjualan, mengurangi biaya layanan, dan meningkatkan loyalitas. Dapatkan wawasan tentang langkah utama performa komunitas, seperti pesan yang di-posting, pertanyaan yang sudah terpecahkan, dan pengguna yang paling aktif. Dasbor ini siap digunakan dengan segera dan mudah disesuaikan tergantung pada tujuan bisnis tim Anda.",
  "GetData_LocalFile_Title": "File Lokal",
  "GetData_Mailchimp": "Dengan paket konten MailChimp untuk Power BI, dengan cepat identifikasi tren dalam kampanye, laporan, dan pelanggan individual. Temukan siapa pelanggan Anda yang paling banyak berinteraksi, negara mana yang membuka kampanye terbanyak, dan bagaimana tren berubah dari waktu ke waktu. Telusuri data MailChimp Anda di Power BI tanpa pengetahuan pengodean. Pembaruan data otomatis akan membantu Anda membuat keputusan paling tepat waktu.",
  "GetData_Mandrill": "Mandrill adalah layanan email yang memungkinkan Anda mengelola dan mengirimkan kampanye email massal dan buletin API. Power BI memanfaatkan Mandrill dengan memungkinkan Anda menganalisis tren dan informasi penting tentang kampanye Anda secara cepat. Dengan sekali klik, Anda dapat mengimpor data Anda dan mentransformasikannya ke dalam dasbor dan seperangkat laporan yang terkelola dengan baik.",
  "GetData_Marketo": "Hadirkan analisis pemasaran yang sangat lengkap secara langsung ke Power BI dengan paket konten Marketo. Dasbor dan laporan Marketo Anda di Power BI memberikan wawasan kaya ke dalam profil pembeli Anda, laju keberhasilan kampanye pemasaran, keterlibatan email, dan sebagainya. Gunakan dasbor dan laporan yang disediakan, atau sesuaikan untuk menyorot informasi yang paling penting untuk Anda.",
  "GetData_MicrosoftDynamicsCRMPSAAccountManager": "Solusi ini menyertakan konten Account Manager untuk melihat ke dalam saluran penjualan, kinerja pelanggan, dan metrik penjualan.",
  "GetData_MicrosoftDynamicsCRMPSAPracticeManager": "Solusi ini menyertakan konten untuk Manajer Praktik termasuk KPI keuangan, misalnya pendapatan, biaya, margin, dan metrik lainnya tentang pemanfaatan, penjualan, dan tagihan.",
  "GetData_MicrosoftDynamicsCRMPSAResourceManager": "Solusi ini menyertakan konten untuk Resource Manager guna melihat permintaan sumber daya, cakupan keterampilan, kapasitas, dan pemanfaatan.",
  "GetData_MicrosoftDynamicsCrm": "Hubungkan ke akun Microsoft Dynamics CRM Anda untuk mengakses wawasan tentang kesempatan Anda, akun Anda, dan banyak lagi. Paket konten ini dirancang secara khusus untuk manajer penjualan, menyediakan rincian tentang kinerja pemasaran, aliran, dan aktivitas. Dasbor dan laporan dibuat di atas model berfitur lengkap, jadi Anda dapat menjelajahi dan menganalisis data Anda sesuai kebutuhan.",
  "GetData_MicrosoftDynamicsMarketing": "Gunakan paket konten Microsoft Dynamics Marketing untuk Power BI guna membangun analisis kinerja pemasaran Anda dengan cepat. Paket konten ini dirancang khusus untuk manajer pemasaran yang berfokus terhadap penciptaan permintaan. Komponen-komponennya diambil secara langsung dari database pemasaran Anda untuk memberikan laporan kontak pemasaran, aliran prospek, analisis segmen, dan banyak lagi. Power BI secara otomatis membuat laporan dan dasbor yang memberi Anda titik mulai yang sangat bagus untuk mengeksplorasi dan menganalisis data pemasaran Anda.",
  "GetData_MicrosoftDynamicsNAV": "Hubungkan ke instans Microsoft Dynamics NAV Anda dan dapatkan akses secara langsung ke wawasan kinerja bisnis. Aplikasi dirancang secara khusus bagi pemilik, pengelola, dan eksekutif SMB untuk mengamati pelanggan, penjualan, keuangan, dan inventaris dengan saksama dari waktu ke waktu. Dasbor dan laporan berada di bagian atas model unggulan lengkap, memungkinkan Anda untuk menjelajahi dan menganalisis data yang diperlukan. Refresh otomatis memastikan Anda selalu melihat data terbaru.",
  "GetData_MyOrganization": "Organisasi saya",
  "GetData_MyOrganizationDesc": "Temukan aplikasi yang diterbitkan oleh orang lain di organisasi Anda.",
  "GetData_MyWorkspace": "Ruang Kerja Saya",
  "GetData_NeedHelpConnecting": "Memerlukan bantuan untuk menghubungkan? ",
  "GetData_NoSearchResultsFound": "Tidak ditemukan hasil pencarian.",
  "GetData_OK": "OK",
  "GetData_Office365Monitor": "Menganalisis pemadaman dan data kinerja kesehatan data Office 365 secara mudah dengan Power BI dan paket konten Office365Mon. Power BI mengambil data Anda, termasuk penyelidikan pemadaman dan kesehatan, lalu membangun sebuah dasbor dan laporan berbeda berdasarkan data tersebut.",
  "GetData_Onboarding_DownloadDesktop": "{0} untuk pengalaman pembuatan laporan terbaik",
  "GetData_Onboarding_DownloadDesktopLink": "Unduh Power BI Desktop",
  "GetData_OneDriveBusiness_Title": "OneDrive - Bisnis",
  "GetData_OneDrivePersonal_Title": "OneDrive - Personal",
  "GetData_OneDriveProUpsell_Link": "Hubungkan, edit, dan lihat file Excel di Power BI",
  "GetData_OneDriveProUpsell_Text": "Apakah Anda memiliki file Excel yang tersimpan di OneDrive for Business?",
  "GetData_OpportunityAnalysisSample": "Contoh dasbor dan laporan industri yang mendasari ini menganalisis perusahaan perangkat lunak yang memiliki 2 saluran penjualan: langsung dan mitra. Manajer Penjualan membuat dasbor ini untuk melacak peluang dan pendapatan berdasarkan wilayah, volume kesepakatan, dan saluran. Manajer Penjualan bergantung pada 2 ukuran pendapatan, pendapatan dan pendapatan terdiskon. Pendapatan adalah perkiraan pendapatan perusahaan oleh tenaga penjual. Pendapatan Terdiskon dihitung dengan cara Pendapatan X % Peluang dan biasanya dianggap sebagai pemrediksi pendapatan penjualan aktual. Peluang ditentukan oleh Tahap Penjualan saat ini dari kesepakatan. Ini adalah data asli dari obviEnce (www.obvience.com) yang telah dianonimkan.",
  "GetData_OpportunityAnalysisSample_Title": "Sampel Analisis Peluang",
  "GetData_Or": "atau",
  "GetData_PartnerShowcase": "Tampilan Mitra",
  "GetData_PlanviewEnterprise": "Dengan paket konten Planview Enterprise, Anda dapat memvisualisasikan sumber daya dan data pengelolaan kerja dengan cara yang benar-benar baru langsung di Power BI. Gunakan kredensial masuk Planview Enterprise Anda untuk melihat biaya investasi portofolio Anda secara interaktif, memahami saat Anda melebihi atau di bawah dari anggaran, dan mengetahu seberapa baik proyek Anda sejajar dengan prioritas strategis perusahaan. Anda juga dapat memperluas dasbor dan laporan modern untuk mendapatkan wawasan yang paling penting bagi Anda.",
  "GetData_PowerBI_In_60_Seconds": "Power BI dalam 60 detik",
  "GetData_ProcurementAnalysisSample": "Contoh dasbor dan laporan industri yang mendasari ini menganalisis pengeluaran perusahaan produksi untuk vendor berdasarkan kategori dan lokasi, dan memungkinkan kita menjelajahi area berikut: vendor teratas, kategori paling menghabiskan biaya, vendor mana yang memberikan diskon terbesar, dan kapan diskon diberikan. Ini adalah data asli dari obviEnce (www.obvience.com) yang telah dianonimkan.",
  "GetData_ProcurementAnalysisSample_Subtext": "Klik data dalam sampel ini untuk menemukan fungsi laporan.",
  "GetData_ProcurementAnalysisSample_Title": "Sampel Analisis Pengadaan",
  "GetData_ProjectOnline": "Impor dan analisis data dari Project Online di Power BI. Paket konten dirancang untuk membantu Anda terhubung dengan cepat ke penyewa Project Online di Office 365 dan mengunduh berbagai data dengan cepat untuk menjelajahi dan mengawasi semua aspek utama penerapan PPM Anda secara visual, misalnya Proyek, Masalah, Risiko, dan banyak lainnya.",
  "GetData_Projectplace": "Dengan paket konten Projectplace, Anda dapat memvisualisasikan data proyek kolaboratif dengan cara yang benar-benar baru di Power BI. Gunakan kredensial masuk Projectplace Anda untuk secara interaktif melihat statistik proyek utama, menemukan siapa anggota tim yang paling aktif dan produktif, dan mengidentifikasi kartu risiko dan aktivitas di seluruh proyek dalam akun Projectplace Anda. Anda juga dapat memperluas dasbor dan laporan modern untuk mendapatkan wawasan yang paling penting bagi Anda.",
  "GetData_PublishedBy": "Diterbitkan oleh {0}",
  "GetData_PublishedDatasets": "Himpunan data yang diterbitkan",
  "GetData_QuickbooksOnline": "Dapatkan wawasan tentang bisnis dengan menghubungkan ke QuickBooks Online dengan paket konten Power BI ini. Dengan kredensial admin QuickBooks Online, Power BI secara otomatis membuat dasbor dengan wawasan ke aliran kas bisnis, profitabilitas, pelanggan, dan masih banyak lagi. Gunakan dasbor dan laporan default, atau ubah untuk menyoroti informasi yang paling penting bagi Anda.",
  "GetData_Retail_Analysis_Sample": "Contoh dasbor dan laporan industri yang mendasari ini menganalisis data penjualan eceran item yang dijual di berbagai toko dan distrik. Metrik membandingkan kinerja tahun ini dengan tahun lalu dalam area berikut: penjualan, unit, margin kotor, dan selisih, serta analisis toko baru. Ini adalah data asli dari obviEnce (www.obvience.com) yang telah dianonimkan.",
  "GetData_Retail_Analysis_Sample_Title": "Sampel Analisis Eceran",
  "GetData_SQLSentry": "Gunakan Power BI untuk menganalisis dan berbagi data kinerja dan operasional yang dikumpulkan oleh SQL Sentry. Dapatkan wawasan tentang kesehatan lingkungan SQL Server dan Windows. Paket konten ini mencakup visualisasi yang hebat guna membantu mengevaluasi dan mengelola sumber daya yang lebih baik untuk beberapa bidang kunci, termasuk:\r\n·         Kesehatan Server\r\n·         Ketersediaan Server\r\n·         Pemanfaatan Disk\r\n·         Penggunaan CPU\r\n·         Penggunaan Memori\r\n\r\nUntuk menggunakan dasbor ini, Anda harus menginstal SQL Sentry dan memantau setidaknya satu server, dan sinkronisasi cloud harus diaktifkan.",
  "GetData_SSAS_Deprecation_Notice": "Tidak diperbolehkan menyambungkan ke sumber data ini secara langsung dari layanan Power BI. Untuk membuat laporan dinamis dengan data dan metrik yang sudah Anda miliki dalam solusi layanan analisis, gunakan himpunan data yang diterbitkan sebagai gantinya. Hubungi pemilik database Layanan Analisis jika himpunan data yang diterbitkan belum dibuat. {0}",
  "GetData_SalesAndMarketingSample": "Contoh dasbor dan laporan industri yang mendasari ini menganalisis perusahaan produksi bernama VanArsdel Ltd. Dasbor ini dibuat oleh Ketua Staf Pemasaran (CMO) VanArsdel untuk mengawasi sentimen, penjualan, volume produk, dan pangsa pasar perusahaan dan industri. Ini adalah data asli dari obviEnce (www.obvience.com) yang telah dianonimkan.",
  "GetData_SalesAndMarketingSample_Title": "Sampel Pemasaran dan Penjualan",
  "GetData_Salesforce": "Sambungan akun Tenaga Penjualan, lalu pilih satu atau beberapa laporan Tenaga Penjualan Anda. Laporan ini akan diimpor ke dalam beberapa tabel dalam himpunan data baru, memungkinkan Anda untuk mulai membangun visual kaya dan dasbor tidak berdasarkan laporan yang paling banyak digunakan.",
  "GetData_SalesforceEmbeddedConfigurationDescription": "Pilih satu atau beberapa laporan Salesforce himpunan data untuk mulai membuat visual kaya dan dasbor.",
  "GetData_SampleContentPacks_LinkText": "Paket konten sederhana",
  "GetData_Samples": "Sampel",
  "GetData_Samples_Keytip": "L",
  "GetData_SeeDetails": "Lihat selengkapnya.",
  "GetData_SelectADashboardBasedOnYourRoleInYourOrganization": "Pilih dasbor berdasarkan peran Anda dalam organisasi Anda.",
  "GetData_SelectYourSalesforceData": "Memilih data Salesforce Anda",
  "GetData_Sendgrid": "Dengan paket konten SendGrid, pantau semua metrik email penting Anda di sebuah dasbor menggunakan Power BI. Gali laporan secara terperinci yang dapat diatur sesuai kebutuhan. Dengan mengaktifkan statistik lanjutan SendGrid, Anda dapat memantau metrik terpenting Anda dan mengukur interaksi untuk email yang Anda kirimkan.",
  "GetData_ServicePack_Link": "Paket Konten Layanan",
  "GetData_Services": "Layanan",
  "GetData_ServicesDesc": "Pilih aplikasi dari layanan online yang Anda gunakan.",
  "GetData_SharePoint_Title": "SharePoint - Situs Tim",
  "GetData_SignInToYourOneDrivePersonalAccount": "Masuk ke akun OneDrive pribadi Anda",
  "GetData_SignInToYourSalesforceAccount": "Masuk ke akun Salesforce pribadi Anda",
  "GetData_Smartsheet": "Dapatkan wawasan mengenai pekerjaan Anda dengan paket konten Smartsheet untuk Power BI. Paket konten ini memberikan tampilan komprehensif ke lingkungan Smartsheet Anda, termasuk jumlah ruang kerja, lembar dan laporan yang Anda miliki, siapa kolaborator dan pembuat teratas, kapan lembar Anda diubah atau diperbarui, serta mengidentifikasi tren penting yang membantu memahami bagaimana Anda dan organisasi menggunakan Smartsheet untuk berkolaborasi dalam pekerjaan.",
  "GetData_SparkPost": "Menghubungkan ke SparkPost secara langsung dari Power BI memungkinkan Anda mengakses wawasan yang hebat tentang email. Masuk ke Power BI menggunakan kredensial SparkPost untuk membuat pemahaman mendalam tentang keterlibatan email dengan basis penerima Anda. Dasbor modernnya memberikan kumpulan tampilan lengkap dan dapat diubahsuai sepenuhnya. Anda dapat mengajukan pertanyaan tentang data untuk kampanye yang diberikan, atau mengeklik ubin untuk membuka laporan utama dan mengubah ubin di dasbor.",
  "GetData_SqlDbAuditing": "Azure SQL Database Auditing melacak peristiwa database dan menulis peristiwa yang diaudit ke sebuah log audit di akun Azure Storage. Paket konten Power BI merangkum data log audit, dan dapat membantu menjaga kepatuhan hukum dan memahami aktivitas database. Tingkatkan wawasan untuk perbedaan dan keanehan yang dapat mengindikasikan masalah bisnis atau dugaan pelanggaran keamanan dengan menggunakan dasbor dan laporan yang dibuat secara otomatis oleh Power BI.",
  "GetData_SqlServerAnalysisServices": "Dengan Power BI, Anda dapat membuat laporan dan mashup dinamis dengan data dan metrik yang telah dimiliki di solusi SQL Server Analysis Services lokal Anda. Untuk memulai, klik Hubungkan, pilih server, lalu pilih model data. \r\n\r\n Server Analysis Services yang Didukung: \r\n\t - SQL Server 2012 dan model Analysis Services Tabular yang lebih baru",
  "GetData_StatsNFL2014SeasonRecap": "Jelajahi statistik dari musim reguler National Football League dan babak penyisihan musim 2014. Statistik dan pengukuran utama disediakan per pertandingan untuk setiap tim dan pemain, dengan data tambahan mengenai kehadiran penggemar, cuaca saat pertandingan, dan latar belakang pemain.\r\nSalinan sampel ini dapat Anda gunakan untuk melalukan percobaan. Anda selalu dapat terhubung kembali ke sampel untuk mendapatkan salinan baru.",
  "GetData_StatsNFL2014SeasonRecap_Title": "Rekap Season STATISTIK NFL 2014",
  "GetData_Stripe": "Stripe memungkinkan bisnis mengelola pembayaran online dengan cepat dan mudah. Paket konten Power BI Stripe terhubung ke metrik yang tersedia, yang menawarkan wawasan lebih dalam terhadap data pembayaran Anda. Lihat metrik utama pada tagihan, pelanggan, faktur, dan lainnya. Data disegarkan setiap malam untuk memastikan dasbor dan analisis Anda selalu terbarui.",
  "GetData_SubmitAnIdea": "Kirimkan gagasan",
  "GetData_SubmitAnIdea_Keytip": "I",
  "GetData_SupplierQualityAnalysisSample": "Contoh dasbor dan laporan industri yang mendasari ini berfokus pada salah satu tantangan rantai persediaan yang khas — analisis kualitas penyedia. Dua metrik utama yang berperan dalam analisis ini: jumlah total kerusakan dan total nonaktif yang disebabkan oleh kerusakan ini. Contoh ini memiliki dua tujuan utama. Yang pertama, memahami penyedia terbaik dan terburuk, terkait kualitas. Yang kedua, mengidentifikasi pabrik mana yang dapat menemukan dan menolak kerusakan dengan lebih baik, untuk meminimalkan ketidakaktifan. Ini adalah data asli dari obviEnce (www.obvience.com) yang telah dianonimkan.",
  "GetData_SupplierQualityAnalysisSample_Title": "Sampel Analisis Kualitas Pemasok",
  "GetData_SweetIQ": "Lacak dan analisis dengan mudah ekosistem pencarian lokal Anda dengan konektor SweetIQ Power BI. Masuk dengan akun SweetIQ guna meninjau daftar pencarian untuk semua lokasi Anda serta menganalisis dan memantau tinjauan pelanggan. Gunakan dasbor dan laporan yang disediakan, atau ubah untuk menyoroti informasi yang paling penting bagi Anda. Data secara otomatis diperbarui setiap hari dengan yang terbaru dari SweetIQ berdasarkan jadwal yang telah Anda tetapkan.",
  "GetData_Troux": "Dengan paket konten Troux, Anda dapat memvisualisasikan repositori Arsitektur Perusahaan dengan cara yang sama sekali baru, langsung dalam Power BI. Gunakan kredensial masuk Troux Anda untuk secara interaktif memvisualisasikan kemampuan bisnis Anda, aplikasi yang memberikan kemampuan tersebut, dan teknologi yang mendukung aplikasi tersebut di akun Troux Anda. Anda juga dapat memperpanjang dasbor secara langsung, dan laporan untuk mendapatkan wawasan yang paling penting bagi Anda.",
  "GetData_Try_This_Tutorial_Or_Watch_A_Video_1": "Cobalah tutorial ini",
  "GetData_Try_This_Tutorial_Or_Watch_A_Video_2": "atau",
  "GetData_Try_This_Tutorial_Or_Watch_A_Video_3": "tonton video",
  "GetData_TutorialLinkPreface_Text": "Memerlukan panduan lainnya?",
  "GetData_Twilio": "Visualkan data dari akun Twilio Anda secara langsung ke Power BI. Sambungkan dengan kredensial Twilio Anda dan dapatkan segera wawasan dari penggunaan Twillio Anda, seperti panggilan atau pesan Anda dari waktu ke waktu, nomor telepon Twillio Anda yang paling aktif, jumlah pesan dan panggilan yang dikirim dan diterima, dan masih banyak lagi. Paket konten Power BI akan membuat dasbor lengkap yang Anda gunakan untuk memantau data Anda serta laporan lengkap untuk jelajahi data lebih dalam.",
  "GetData_UnableToRetrieveTheAuthenticationEndpoint": "Tidak dapat mengambil titik akhir autentikasi",
  "GetData_UploadOrConnectData_Title": "Buat konten baru",
  "GetData_UploadingFile": "Mengunggah {0}",
  "GetData_UserVoice": "Pantau dan jelajahi data UserVoice di Power BI cukup dengan menghubungkan ke UserVoice menggunakan kredensial admin Anda. Dengan Power BI, Anda akan memiliki data tiket, saran, dan data kepuasan pengguna langsung di ujung jari Anda. Gunakan dasbor dan laporan yang siap Anda gunakan untuk menganalisis data, mengkustomisasi sesuai keinginan guna menyoroti informasi yang paling penting untuk Anda. Power BI akan menyegarkan data UserVoice setiap hari, sehingga dasbor dan laporan Anda selalu up-to-date.",
  "GetData_VMob": "VMob adalah platform personalisasi pintar yang memungkinkan pengecer dan merek lainnya yang langsung berhadapan dengan pelanggan membuat kampanye pemasaran yang sangat terpersonalisasi untuk menjangkau pelanggan di waktu dan tempat yang benar-benar tepat. Platform ini terpadu dengan aplikasi telepon cerdas yang dimiliki oleh merek tersebut untuk terus mengumpulkan dan menyimpan data waktu nyata (termasuk lokasi, kecepatan perpindahan, cuaca lokal, dan acara di sekitar). VMob dan Power BI memberikan tampilan waktu nyata dari aktivitas penjualan dan pemasaran Anda di setiap titik petualangan pelanggan: dari penjelajahan online dan seluler hingga aktivitas dalam toko, hingga titik penjualan. Metrik pemasaran kami lebih dari sekadar tampilan halaman dan klik; melaporkan penjualan dalam toko dan pendapatan untuk pembuatan keputusan yang lebih tepat.",
  "GetData_ViewTutorial": "Tutorial",
  "GetData_VisualStudioOnline": "Memvisualisasikan aktivitas kode sumber Power BI dengan menyambungkan ke Visual Studio Online. Paket konten Power BI otomatis membuat dasbor dan laporan dengan tampilan sekilas dari Git, permintaan tarik, dan versi aktivitas kontrol diantara proyek yang dapat dikonfigurasi untuk akun Anda. Anda dapat mengkustomisasi dasbor dan laporan untuk menyoroti wawasan yang lebih mendalam tentang hal yang paling Anda pedulikan.",
  "GetData_VisualStudioOnlineVNext": "Visualisasikan aktivitas teknis Anda dalam Power BI dengan terhubung ke Microsoft Visual Studio Online. Laporan dan dasbor default memberikan tampilan sekilas tentang kerja dan kode di seluruh proyek yang Anda konfigurasi untuk akun. Anda dapat menyesuaikan dasbor dan laporan untuk menyorot wawasan yang lebih mendalam yang paling Anda butuhkan. Data yang muncul di Power BI akan diperbarui dari Microsoft Visual Studio Online sesuai dengan jadwal yang Anda kontrol.",
  "GetData_Watch_Our_Video_Course_Or_Try_This_Tutorial_1": "Tonton kursus video kami",
  "GetData_Watch_Our_Video_Course_Or_Try_This_Tutorial_2": "atau",
  "GetData_Watch_Our_Video_Course_Or_Try_This_Tutorial_3": "Cobalah tutorial ini",
  "GetData_Webtrends": "Webtrends menawarkan wawasan mendalam seputar analisis web dan statistik web, memungkinkan perusahaan untuk terlibat lebih baik dengan pelanggannya. Paket konten Power BI memungkinkan Anda memvisualisasikan dan menjelajahi data analisis web Webtrends, dengan peningkatan selanjutnya meliputi analisis sosial dan seluler. Dimulai dengan bagian luar kotak, Anda dapat menyesuaikan dasbor dan laporan berdasarkan data di himpunan data yang dikurasi. Data yang muncul di Power BI akan diperbarui sesuai jadwal yang Anda kendalikan.",
  "GetData_WelcomeDescLine1": "Anda berada di jalur untuk menjelajahi data Anda dan memantau apa yang penting.",
  "GetData_WelcomeDescLine2": "Mari mulai dengan mengambil beberapa data.",
  "GetData_WelcomeTitle": "Selamat Datang Power BI",
  "GetData_WindowsDevCenter": "Masuk dengan akun pengembang Windows Store Anda untuk mendapat data tentang aplikasi Anda. Dapatkan perincian tentang kinerja dan kualitas aplikasi Anda, termasuk peristiwa crash dan tidak responsif. Anda juga dapat melihat berapa banyak orang telah mengambil aplikasi Anda dan produk dalam aplikasinya, bersama dengan perincian demografi dan platform.",
  "GetData_Xero": "Xero adalah perangkat lunak akuntansi online yang mudah digunakan yang dirancang khusus untuk usaha skala kecil. Xero memiliki semua yang dibutuhkan – untuk menjalankan bisnis, termasuk faktur, membayar tagihan, pengembalian pajak penjualan, pelaporan, dan banyak lagi. Membuat visualisasi yang menarik berdasarkan keuangan Xero dengan konten paket Power BI ini. Dasbor default Anda mencakup banyak metrik bisnis kecil seperti posisi uang tunai, pengeluaran dibandingkan pendapatan, tren penurunan laba, hari debitur, dan laba atas investasi.",
  "GetData_Zendesk": "Lakukan analisis data Zendesk Anda di Power BI dengan paket konten Zendesk. Hubungkan dengan kredensial akun admin Zendesk Anda, dan Power BI akan secara otomatis membuat dasbor dengan laporan yang memberikan wawasan tentang volume tiket dan kinerja agen. Gunakan dasbor dan laporan yang disediakan, atau kustomisasikan untuk menyoroti informasi yang terpenting untuk Anda.",
  "GetData_Zendesk_FinePrint": "Data Anda di layanan Zendesk ditransmisikan ke Power BI sehingga Anda dapat melakukan analitika bisnis.",
  "GetData_Zuora": "Visualisasikan pendapatan, penagihan, dan data langganan penting dalam Power BI dengan menghubungkan akun Zuora Anda. Gunakan laporan dan dasbor bawaan untuk menganalisis tren penggunaan, melacak penagihan dan pembayaran, dan mengawasi pendapatan rutin, atau sesuaikan agar cocok dengan kebutuhan pelaporan dan dasbor Anda sendiri. Pengguna lain di organisasi Anda dapat menyesuaikan laporan dan dasbor mereka sendiri, dan penyesuaian ini dapat dibagikan dengan pengguna lain jika mau. Data otomatis diperbarui setiap hari guna memastikan Anda memiliki informasi yang terbaru.",
  "GetData_comScore": "comScore Digital Analytix memungkinkan pelanggan menemukan dan menganalisis metrik bisnis kunci. Paket konten Power BI memungkinkan Anda mengawasi dan menjelajahi data analisis web, termasuk kunjungan dan tampilan halaman berdasarkan negara, browser, dan lainnya. Paket konten ini mencakup dasbor dan laporan yang dapat disesuaikan sepenuhnya berdasarkan himpunan data yang dikurasi di baliknya. Data akan akan disegarkan sesuai jadwal yang Anda kendalikan, memastikan data Anda selalu yang terbaru.",
  "GetData_tyGraph": "Navigasikan wawasan dari data Yammer Anda secara lebih mendalam dengan paket konten tyGraph. Ambil tindakan menggunakan metrik kami yang paling dicari, meliputi Kontributor Teratas, Grup Teratas, Kunjungan File, dan banyak lagi. Paket konten tyGraph dilengkapi dengan 7 dasbor Power BI utama atau gunakan model data ekstensif kami untuk membuat wawasan yang penting bagi Anda. tyGraph secara otomatis me-refresh data Yammer Anda setiap malam.",
