  "Insights_ExploreToggleTooltip": "Untuk ukuran aditif, Anda dapat membandingkan proporsi yang menggunakan dua sumbu terpisah, atau membandingkan nilai absolut yang menggunakan satu sumbu yang sama.",
  "Insights_ExploreTutorialAdditiveColumnAnalysis": "Lihat berapa bagian dari total setiap nilai yang berkontribusi dalam setiap periode. Anda dapat melihat dalam bagan tumpukan kolom 100% bahwa Tablet dan Keyboard meningkatkan pangsa penjualan relatif antara 2010 dan 2011.",
  "Insights_ExploreTutorialAdditiveRibbonAnalysis": "Lihat bagaimana nilai teratas berubah antara dua periode. Anda dapat melihat dalam grafik pita ini bahwa penjualan Keyboard meningkat dari posisi ketiga menjadi pertama antara 2010 dan 2011, sedangkan penjualan Layar menurun dari posisi kedua menjadi kelima.",
  "Insights_ExploreTutorialAdditiveScatterAnalysis": "Lihat nilai yang naik atau turun dari satu periode ke periode berikutnya. Anda dapat melihat dalam visual menyebar ini bahwa nilai produk di area atas meningkat, sementara yang lainnya menurun. Jarak dari tepi menunjukkan besarnya perubahan.",
  "Insights_ExploreTutorialAdditiveWaterfallAnalysis": "Lihat perubahan nilai mana yang memiliki dampak terbesar pada pengukuran. Anda dapat melihat di bagan air terjun bahwa sebagian besar peningkatan penjualan antara 2010 dan 2011 berasal dari peningkatan Keyboard dan Laptop.",
  "Insights_ExploreTutorialDistributionAnalysis": "Lihat bagaimana tiap nilai filter memengaruhi distribusi. Distribusi asli ditampilkan dengan warna abu-abu, dan dibandingkan dengan filter yang dipilih.",
  "Insights_ExploreTutorialDistributionVisual": "Lihat satu nilai filter dalam satu waktu, atau control-klik untuk memilih beberapa nilai. Untuk ukuran aditif, Anda dapat beralih antara membandingkan proporsi atau nilai absolut.",
  "Insights_ExploreTutorialOpaqueColumnAnalysis": "Lihat bagaimana uraian pengukuran berubah antara periode. Anda dapat melihat dalam grafik kolom ini perbandingan rata-rata harga rumah untuk setiap tipe antara 2010 dan 2011.",
  "Insights_ExploreTutorialOpaqueRibbonAnalysis": "Lihat bagaimana nilai teratas berubah antara dua periode. Anda dapat melihat dalam grafik pita ini bahwa harga Rumah di kota meningkat dari posisi ketiga menjadi pertama antara 2010 dan 2011, sedangkan harga Kondo menurun dari posisi kedua menjadi kelima.",
  "Insights_ExploreTutorialRatioAnalysisFirst": "Lihat perubahan nilai yang memiliki dampak terbesar pada rasio pengukuran. Anda dapat melihat dalam diagram menyebar ini bahwa ada banyak produk Kecil dan nilai rata-rata produk tersebut naik secara signifikan antara 2010 dan 2011, mendorong kenaikan rata-rata keseluruhan.",
  "Insights_ExploreTutorialRatioAnalysisSecond": "Skenario lain digambarkan dalam diagram menyebar ini. Produk Menengah memiliki nilai rata-rata buruk, yang tidak meningkat. Namun, karena jumlah produk Menengah turun signifikan pada tahun 2009, rata-rata keseluruhan naik.",
  "Insights_ExploreTutorialRatioVisual": "Untuk menyoroti nilai dengan dampak terbesar, pilih dari daftar di atas visual. Gunakan control-klik untuk memilih beberapa item.",
