  "Marketplace": "MARKETPLACE",
  "MashUpContentProvider_AppFigures_Description1": "Hubungkan dan jelajahi data appFigures Anda dalam Power BI. Dasbor kreatif ini memungkinkan Anda memantau dan menjelajahi data tentang semua aplikasi Anda dari satu tempat tunggal. Untuk setiap aplikasi, Anda dapat melacak jumlah unduhan, termasuk caranya dinilai dan negara mana yang menggunakan aplikasi Anda. Anda juga dapat melacak pembelian dalam aplikasi dan klik iklan, agar benar-benar memahami pendapatan dari aplikasi Anda.",
  "MashUpContentProvider_AppFigures_More2": " menyambungkan ke data appFigures",
  "MashUpContentProvider_CustomerProfitabilitySample_Description1": "Dasbor sampel industri ini dan laporan yang mendasarinya menganalisis perusahaan yang memproduksi materi pemasaran.  Dasbor ini dibuat oleh CEO untuk melihat matrik kunci 5 manajer unit bisnisnya (alias eksekutif), produk, pelanggan, dan margin kotor (GM). Sekilas ia dapat melihat faktor yang berpengaruh terhadap profitabilitas.",
  "MashUpContentProvider_DCU_Description1": "Digital Crimes Unit (DCU) adalah tim teknis dan hukum internasional yang bekerja dengan mitra, untuk membantu menciptakan dunia digital yang aman. DCU beroperasi bersama-sama dengan Tim Respons Gawat Darurat Komputer dan Penyedia Layanan Internet untuk menahan botnet dari penjahat dunia maya. Botnet ini dapat disertakan dalam berbagai aktivitas mulai dari email spam dan penipuan klik hingga pelanggaran privasi dan penipuan keuangan. Setelah Microsoft menahan botnet ini, perangkat yang terpengaruh akan terus menghubungi Digital Crimes Unit yang memungkinkan pelaporan dan memberi tahu bahwa perangkat tersebut masih terpengaruh malware.",
  "MashUpContentProvider_DCU_Description2": "Hubungkan ke data organisasi Microsoft untuk memperoleh wawasan ke ringkasan panggilan yang dilakukan ke DCU setiap hari oleh perangkat yang masih terpengaruh beberapa botnet yang telah ditahan oleh Digital Crimes Unit. Anda akan mendapatkan dasbor yang berisi laporan yang dicadangkan oleh data dari contoh SQL Server Analysis Services.  Anda dapat menyesuaikan dasbor dengan menambahkan metrik penting untuk Anda.",
  "MashUpContentProvider_DCU_Support": "Pertanyaan terkait data dan laporan: DCU_BI_Status@microsoft.com",
  "MashUpContentProvider_DCU_Title": "Digital Crimes Unit",
  "MashUpContentProvider_Description": "Penyedia konten pihak ketiga untuk Power BI.",
  "MashUpContentProvider_DynamicCRM_Description1": "Sambungkan ke akun Microsoft Dynamics CRM dan langsung dapatkan akses ke wawasan tentang kesempatan, akun, dan lainnya. Konektor ini dirancang khusus untuk Manajer Penjualan, yang memberikan detail tentang aktivitas, alur, dan kinerja penjualan. Laporan dan dasbor dibuat menggunakan model unggulan terlengkap, sehingga Anda dapat menjelajahi dan menganalisis data yang dibutuhkan. Penyegaran otomatis memastikan Anda selalu melihat data terbaru.",
  "MashUpContentProvider_DynamicCRM_More2": " menyambungkan ke data Microsoft Dynamics CRM",
  "MashUpContentProvider_DynamicMarketing_Description1": "Gunakan Kemasan Konten Pemasaran Microsoft Dynamics untuk Power BI guna membuat analisis kinerja pemasaran secara cepat. Kemasan konten dirancang khusus untuk manajer pemasaran untuk menghasilkan permintaan. Komponennya menggambarkan database pemasaran secara langsung untuk memberikan laporan tentang topik yang meliputi: kontak dan perusahaan pemasaran; analisis wilayah; pemilik kampanye dan ROMI; alur utama, penilaian, dan penghasilan setiap waktu; analisis segmen; dan kinerja halaman depan, email pemasaran, dan halaman web terlacak. Laporan dan dasbor dibuat menggunakan model unggulan untuk menghasilkan permintaan. Laporan dan dasbor dari luar memberi Anda titik awal yang bagus untuk menjelajahi dan menganalisis data pemasaran Anda.",
  "MashUpContentProvider_Error_MissingModelFromPackage": "Tidak ada model dari paket",
  "MashUpContentProvider_GitHub_Description1": "Visualisasikan berbagai jenis aktivitas repositori di Power BI dengan menyambungkan data GitHub. Anda akan mendapatkan dasbor Power BI berisi laporan yang menyediakan wawasan tentang berapa banyak yang terlibat, siapa saja yang paling banyak berkontribusi, dan kapan berlangsung. Gunakan dasbor dan laporan yang diberikan, atau sesuaikan untuk menyorot informasi yang paling Anda minati.",
  "MashUpContentProvider_GitHub_Description2": "Data di Power BI diperbarui setiap hari dari GitHub sesuai dengan jadwal yang Anda kontrol.",
  "MashUpContentProvider_GitHub_More2": " menyambungkan ke Data GitHub",
  "MashUpContentProvider_GoogleAnalytics_Description1": "Visualisasikan data secara langsung dari akun Google Analytics di Power BI. Sambungkan menggunakan kredensial Google dan segera dapatkan wawasan dari situs yang Anda lacak, seperti lalu lintas situs selama 30 hari terakhir atau hari paling banyak dikunjungi dalam minggu ini. Termasuk data dari 180 hari terakhir dan akan otomatis disegarkan setiap hari. Laporan yang ada memberikan tampilan tren setiap waktu dan dapat disesuaikan berdasarkan metrik yang menurut Anda penting.",
  "MashUpContentProvider_HR_Description1": "Hubungkan ke data organisasi Microsoft untuk memperoleh wawasan ke jumlah karyawan, arahan rata-rata, dan hari peringatan. Anda akan mendapatkan dasbor berisi laporan yang dicadangkan oleh data dari contoh SQL Server Analysis Services internal.  Anda dapat menyesuaikan laporan dan dasbor dengan menambahkan metrik penting untuk grup Anda.",
  "MashUpContentProvider_HR_Support": "Pertanyaan terkait data dan laporan: hrreport@microsoft.com",
  "MashUpContentProvider_HR_Title": "Tampilan Orang",
  "MashUpContentProvider_HumanResourcesSample_Description1": "Dasbor sampel industri ini dan laporan yang mendasari menganalisis informasi HR. Departemen HR memiliki mode pelaporan yang sama di berbagai perusahaan, meskipun perusahaan tersebut berbeda menurut industri atau ukuran. Sampel ini memperlihatkan karyawan baru, karyawan aktif, dan karyawan yang keluar serta mengungkapkan setiap tren dalam strategi rekrutmen. Tujuan utama kami adalah untuk memahami:",
  "MashUpContentProvider_HumanResourcesSample_Description2": "Siapa yang merekrut.",
  "MashUpContentProvider_HumanResourcesSample_Description3": "Penyimpangan dalam strategi perekrutan.",
  "MashUpContentProvider_HumanResourcesSample_Description4": "Tren dalam pemisahan secara disengaja.",
  "MashUpContentProvider_ITSpendAnalysisSampleSample_Description1": "Dasbor sampel industri ini dan laporan yang mendasari menganalisis biaya terencana vs. biaya aktual departemen TI perusahaan. Perbandingan ini membantu kami memahami seberapa bagus rencana perusahaan untuk satu tahun dan memungkinkan kami menyelidiki area yang memiliki penyimpangan sangat besar dari rencana. Perusahaan dalam contoh ini menjalani siklus perencanaan tahunan, lalu membuat Perkiraan Terkini yang baru (LE) setiap triwulan guna membantu menganalisis perubahan pengeluaran TI selama tahun pajak.",
  "MashUpContentProvider_ImportButtonText": "Sambung",
  "MashUpContentProvider_MSITNTA_Description1": "Hubungkan ke data organisasi Microsoft untuk memperoleh wawasan ke adopsi teknologi terbaru Aplikasi Microsoft IT di seluruh portofolio solusi yang digunakan karyawan. Anda akan mendapatkan dasbor berisi laporan yang dicadangkan oleh data dari contoh SQL Server Analysis Services.  Anda dapat menyesuaikan dasbor dengan menambahkan metrik yang penting untuk grup Anda.",
  "MashUpContentProvider_MSITNTA_Support": "Pertanyaan terkait data dan laporan: ntacore@microsoft.com",
  "MashUpContentProvider_MSITNTA_Title": "Adopsi Teknologi Baru IT",
  "MashUpContentProvider_MailChimp_Description1": "Gunakan analisis MailChimp untuk mengindentifikasi tren dengan cepat dalam kampanye, laporan, dan pelanggan individu. Temukan siapa pelanggan yang paling terlibat, negara mana yang membuka paling banyak kampanye, atau bagaimana tren berubah dari waktu ke waktu. Power BI memungkinkan pengguna merincikan ke data MailChimp mereka tanpa memerlukan pengetahuan kode, dan pembaruan data otomatis membantu Anda membuat keputusan yang terbaik berdasarkan informasi yang Anda terima.",
  "MashUpContentProvider_MailChimp_More2": " menyambung ke data MailChimp",
  "MashUpContentProvider_Marketo_Description1": "Hadirkan analisis pemasaran yang kaya secara langsung ke Power BI dengan menyambungkan ke Marketo. Tingkatkan kemampuan dasbor Power BI dengan laporan yang memberikan wawasan kaya ke dalam profil pembeli Anda, laju keberhasilan kampanye pemasaran, keterlibatan email, dan sebagainya. Gunakan dasbor dan laporan yang disediakan, atau sesuaikan untuk menyorot informasi yang paling Anda minati.",
  "MashUpContentProvider_Marketo_Description2": "Data di Power BI otomatis diperbarui dari Marketo, sehingga Anda akan selalu melihat data terbaru.",
  "MashUpContentProvider_Marketo_More2": " menyambungkan ke Data Marketo",
  "MashUpContentProvider_NFL2014SeasonRecap_Description1": "Jelajahi statistik National Football League musim reguler dan babak penyisihan musim 2014. Statistik dan pengukuran utama disediakan per pertandingan untuk setiap tim dan pemain, dengan data tambahan untuk kehadiran penggemar, cuaca pada saat pertandingan, dan latar belakang pemain. ",
  "MashUpContentProvider_NFL2014SeasonRecap_Description2": "Salinan contoh ini dapat Anda gunakan untuk percobaan. Anda akan selalu dapat menyambungkan contoh lagi untuk mendapatkan salinan terbaru.",
  "MashUpContentProvider_NFL2014SeasonRecap_ExploreFurther1": "Babak draft mana yang menunjukkan pemain yang paling sering mencetak touchdown di babak penyisihan?",
  "MashUpContentProvider_NFL2014SeasonRecap_ExploreFurther2": "Bagaimana peringkat akademi berdasarkan jumlah snap yang dilakukan mantan pemain saat bermain?",
  "MashUpContentProvider_NFL2014SeasonRecap_ExploreFurther3": "Peringkat QB rata-rata untuk gelandang yang bermain di stadion kandang, jika disukai? ",
  "MashUpContentProvider_NFL2014SeasonRecap_ExploreFurtherDesc1": "Ingin menjelajahi data lebih lanjut? Lanjutkan! Jangan ragu… ",
  "MashUpContentProvider_NFL2014SeasonRecap_ExploreFurtherDesc2": "Jika demikian, data ini ditujukan untuk Anda. Jawaban untuk pertanyaan ini dan pertanyaan yang lain ada di data ini.",
  "MashUpContentProvider_NFL2014SeasonRecap_GetStarted": "Untuk memulai data, contoh menyediakan laporan berikut:",
  "MashUpContentProvider_NFL2014SeasonRecap_GetStarted1": "Rekap skor mingguan tim dengan pimpinan statistik",
  "MashUpContentProvider_NFL2014SeasonRecap_GetStarted2": "Rekap game ke game",
  "MashUpContentProvider_NFL2014SeasonRecap_GetStarted3": "Rekap statistik operan, membawa bola, menerima bola, dan bertahan",
  "MashUpContentProvider_NFL2014SeasonRecap_GetStarted4": "Hasil tidak sesuai dengan laporan",
  "MashUpContentProvider_NFL2014SeasonRecap_GetStarted5": "Demografi pemain",
  "MashUpContentProvider_OpportunityTrackingSample_Description1": "Dasbor sampel industri ini dan laporan yang mendasarinya menganalisis perusahaan perangkat lunak yang memiliki 2 saluran penjualan: secara langsung dan melalui mitra.  Manajer Penjualan membuat dasbor ini untuk melacak peluang dan pendapatan menurut wilayah, ukuran transaksi, dan saluran. Manajer Penjualan mengandalkan 2 pengukuran pendapatan:",
  "MashUpContentProvider_OpportunityTrackingSample_Description2": "Pendapatan – ini adalah perkiraan wiraniaga tentang jumlah pendapatan yang akan diperoleh perusahaan.",
  "MashUpContentProvider_OpportunityTrackingSample_Description3": "Pendapatan Terfaktor – pendapatan ini dihitung sebagai Pendapatan X Probabilitas % dan secara umum diterima sebagai peramal pendapatan penjualan aktual yang lebih akurat.  Probabilitas ditentukan melalui Tahapan Penjualan transaksi saat ini.",
  "MashUpContentProvider_OrgApps_Legal": "Serangkaian data ini berdasarkan pada informasi rahasia Microsoft dan tidak dapat dibagikan dengan pihak eksternal non-Microsoft dalam kondisi apa pun",
  "MashUpContentProvider_PBIExecutionReview_Description1": "Power BI mengaktifkan organisasi Anda untuk memublikasikan sumber data yang sesuai dengan bisnis Anda. Contoh ini menyertakan koleksi data, laporan, dan dasbor.",
  "MashUpContentProvider_PBIExecutionReview_Description2": "Klik tombol Sambungkan untuk memulai. Anda akan melihat dasbor baru yang otomatis dibuat dengan koleksi visual berdasarkan data contoh. Dari dasbor, Anda dapat mengeklik ubin untuk menjelajahi laporan dan data pokok. Anda juga dapat menyematkan visual yang menarik ke dasbor, yang dapat terus Anda pantau. Selain itu, Anda dapat menggunakan bahasa yang natural untuk menjelajahi data dan menyematkan metrik dan visual yang menarik ke dasbor.",
  "MashUpContentProvider_PBIExecutionReview_Title": "Tinjauan Eksekusi Power BI",
  "MashUpContentProvider_ProcurementAnalysisSample_Description1": "Dasbor sampel industri ini dan laporan yang mendasarinya menganalisis pengeluaran perusahaan manufaktur pada vendor menurut kategori dan lokasi, dan mari kita jelajahi area berikut:",
  "MashUpContentProvider_ProcurementAnalysisSample_Description2": "Siapa vendor teratas",
  "MashUpContentProvider_ProcurementAnalysisSample_Description3": "Kategori apa yang menjadi pengeluaran terbesar kita",
  "MashUpContentProvider_ProcurementAnalysisSample_Description4": "Vendor mana yang memberikan diskon tertinggi dan kapan",
  "MashUpContentProvider_QuickBooks_Description1": "Dapatkan wawasan ke dalam bisnis Anda dengan menghubungkan Power BI dengan Quickbooks Online. Hubungkan Power BI ke QuickBooks Online menggunakan kredensial admin QuickBooks Online Anda untuk mendapatkan wawasan ke dalam arus kas bisnis, keuntungan, pelanggan dan lainnya. Gunakan dasbor dan laporan default atau sesuaikan untuk menyoroti informasi yang paling penting bagi Anda.",
  "MashUpContentProvider_QuickBooks_Description2": "Data yang muncul di Power BI akan diperbarui setiap hari dari QuickBooks Online sesuai jadwal yang Anda tetapkan.",
  "MashUpContentProvider_QuickBooks_Description3": "Dengan versi integrasi Power BI dan QuickBooks Online saat ini, satu pengguna admin QuickBooks Online dapat menghubungan dan membuat dasbor Power BI, yang selanjutnya dapat dibagikan dengan pengguna Power BI lainnya.",
  "MashUpContentProvider_QuickBooks_More2": " menghubungkan ke data QuickBooks Online",
  "MashUpContentProvider_RetailSalesSample_Description1": "Dasbor contoh industri dan laporan pokok ini menganalisis data untuk item penjualan eceran yang terjual di beberapa toko dan distrik. Metrik membandingkan kinerja tahun ini dengan tahun lalu dalam bidang: penjualan, unit, margin kotor, dan variasi, serta analisis toko baru. Ini adalah data nyata yang dianonimkan.",
  "MashUpContentProvider_RetailSalesSample_Title": "Contoh Penjualan Eceran",
  "MashUpContentProvider_SQLDBAuditing_Description1": "Audit Azure SQL Database",
  "MashUpContentProvider_SQLDBAuditing_Description2": " melacak peristiwa database dan menulis peristiwa yang diaudit ke sebuah log audit di akun Azure Storage. Audit umumnya tersedia untuk tier layanan Dasar, Standar, dan Premium.",
  "MashUpContentProvider_SQLDBAuditing_Description3": "Paket konten ini dapat membantu menjaga kepatuhan terhadap peraturan, memahami aktivitas database, dan memperoleh wawasan tentang adanya perbedaan dan anomali yang dapat menunjukkan masalah bisnis atau dugaan ancaman keamanan.",
  "MashUpContentProvider_SQLDBAuditing_Description4": "Paket konten ini mengimpor data dari semua tabel yang memuat \"AuditLogs\" di dalam namanya dan menambahkannya ke tabel data tunggal yang bernama \"AuditLogs\".",
  "MashUpContentProvider_SQLSentry_Bullet1": "Kesehatan Server",
  "MashUpContentProvider_SQLSentry_Bullet2": "Ketersediaan Server",
  "MashUpContentProvider_SQLSentry_Bullet3": "Penggunaan Disk",
  "MashUpContentProvider_SQLSentry_Bullet4": "Penggunaan CPU",
  "MashUpContentProvider_SQLSentry_Bullet5": "Penggunaan Memori",
  "MashUpContentProvider_SQLSentry_Description1": "Gunakan Power BI untuk menganalisis dan berbagai data kinerja dan operasional yang dikumpulkan oleh SQL Sentry. Dapatkan wawasan pada kesehatan lingkungan SQL Server dan Windows Anda. Paket konten ini menyertakan visualisasi yang hebat untuk membantu Anda mengevaluasi dan mengelola sumber daya untuk beberapa area kunci dengan lebih baik, termasuk:",
  "MashUpContentProvider_SQLSentry_Description2": "Untuk menggunakan dasbor ini, Anda harus menginstal SQL Sentry dan mengawasi paling tidak satu server. Selain itu, sinkronisasi cloud harus diaktifkan.",
  "MashUpContentProvider_SQLSentry_More2": " menyambung ke data SQL Sentry ke cloud",
  "MashUpContentProvider_Sage_AndMore": "Dan Selengkapnya.",
  "MashUpContentProvider_Sage_Description1": "Aplikasi Sage One Accounting memungkinkan Anda mengimpor dan menganalisis data finansial dan penjualan Anda di Power BI. Setelah terhubung dengan akun Sage One, Anda akan dapat mengimpor data dan menampilkan kinerja perusahaan Anda menggunakan dasbor Power BI yang fleksibel. Anda akan memiliki wawasan langsung ke dalam data Anda untuk menginformasikan keputusan bisnis.",
  "MashUpContentProvider_Sage_Description2": "Sesuaikan dasbor untuk menyertakan metrik yang memberikan Anda informasi yang diperlukan untuk bisnis Anda, kemudian lakukan pengumpulan dan analisis data dengan cara yang Anda inginkan menggunakan beragam alat yang tersedia di Power BI. Semua informasi Sage One Accounting terbaru akan diperbarui secara otomatis, untuk memastikan bahwa Anda selalu dapat memantaunya.",
  "MashUpContentProvider_Sage_More2": " menghubungkan ke data Sage",
  "MashUpContentProvider_Sage_Title": "Metrik sampel mencakup:",
  "MashUpContentProvider_Sage_Top4Sales": "5 Item Teratas berdasarkan Penjualan",
  "MashUpContentProvider_Sage_Top5Customers": "5 Pelanggan Teratas berdasarkan Penjualan",
  "MashUpContentProvider_SalesAndMarketingSample_Description1": "Dasbor sampel industri dan laporan yang mendasarinya ini menganalisis perusahaan yang bernama VanArsdel Ltd. Dasbor ini dibuat oleh VanArsdel Chief Marketing Officer (CMO) untuk mengawasi industri dan pangsa pasar, volume produk, penjualan, dan sentimen perusahaannya.",
  "MashUpContentProvider_Sample_Click": "Klik ",
  "MashUpContentProvider_Sample_Connect": "Sambungkan ",
  "MashUpContentProvider_Sample_ConnectSuffix": "di atas untuk memulai. Power BI membuat dasbor secara otomatis beserta visualisasi berdasarkan data sampel.",
  "MashUpContentProvider_Sample_DataReportDashboard": "Sampel ini berisi dasbor, laporan, dan data.",
  "MashUpContentProvider_Sample_Description3": "Salinan sampel ini adalah milik Anda untuk dijadikan percobaan. Anda selalu dapat terhubung ke sampel untuk mendapatkan salinan lain.",
  "MashUpContentProvider_Sample_InDashboard": "Di dasbor:",
  "MashUpContentProvider_Sample_InDashboard1": "Coba mengetik pertanyaan menggunakan bahasa alami untuk menjelajahi data. Sematkan hasil visualisasi dan metrik ke dasbor Anda.",
  "MashUpContentProvider_Sample_InDashboard2": "Klik ubin untuk menjelajahi data dan laporan yang mendasarinya.",
  "MashUpContentProvider_Sample_InReport": "Dalam laporan:",
  "MashUpContentProvider_Sample_LearnMore": "Selengkapnya tentang hal spesifik di sampel ini",
  "MashUpContentProvider_Sample_LearnMoreDescription": "dan bagaimana Anda dapat meningkatkannya.",
  "MashUpContentProvider_Sample_More": "Tentang sampel",
  "MashUpContentProvider_Sample_Origin": "Sampel ini merupakan bagian dari rangkaian yang menunjukkan cara Anda dapat menggunakan Power BI dengan data, laporan, dan dasbor yang berorientasi bisnis. Ini adalah data sebenarnya dari obviEnce (",
  "MashUpContentProvider_Sample_OriginSuffix": ") yang telah dianonimkan.",
  "MashUpContentProvider_Sample_Report1": "Mengubah visualisasi dari jenis yang satu ke yang lain.",
  "MashUpContentProvider_Sample_Report2": "Memindahkan visualisasi dan tambahkan yang baru.",
  "MashUpContentProvider_Sample_Report3": "Menyematkan visualisasi yang menarik ke dasbor. ",
  "MashUpContentProvider_Sample_Report4": "Mengetahui wawasan yang dapat Anda temukan dalam data.",
  "MashUpContentProvider_Sample_Usage": "Cara menggunakan sampel ini",
  "MashUpContentProvider_SendGrid_AggregatedStats": "Tren data untuk periode waktu tertentu termasuk permintaan, terkirim, dibuka, jumlah klik, pembatalan langganan, pentalan, dan laporan spam",
  "MashUpContentProvider_SendGrid_Description1": "Dengan konektor SendGrid pantau semua metrik email penting di satu dasbor menggunakan Power BI. Setelah menyambung menggunakan kredensial SendGrid, Power BI akan mengimpor metrik email Anda ke dalam satu dasbor. Sehingga Anda dapat menyesuaikan dasbor dan menelusuri yang lebih rinci.",
  "MashUpContentProvider_SendGrid_Description2": "Dengan statistik lanjutan SendGrid yang diaktifkan, Anda akan dapat memantau metrik yang sangat penting secara sekilas dan mengukur keterlibatan pengguna atas email yang Anda kirim.",
  "MashUpContentProvider_SendGrid_EmailMetricsByCategory": "Berdasarkan klien, perangkat, ISP, dan browser",
  "MashUpContentProvider_SendGrid_EmailMetricsByGeography": "Berdasarkan lokasi geografis termasuk negara, negara bagian, dan kota",
  "MashUpContentProvider_SendGrid_EmailMetricsByISP": "Berdasarkan kategori email (misalnya, peringatan pengguna, email selamat datang, konfirmasi, atau buletin)",
  "MashUpContentProvider_SendGrid_More2": " menyambungkan ke data SendGrid",
  "MashUpContentProvider_SendGrid_Title": "Metrik sampel mencakup:",
  "MashUpContentProvider_SupplierQualityAnalysisSample_Description1": "Dasbor sampel industri dan laporan yang mendasarinya ini memfokuskan pada salah satu tantangan rantai pasokan tipikal — analisis kualitas pemasok. Dua metrik utama yang berperan pada analisis ini: jumlah total cacat dan waktu henti total yang menyebabkan cacat ini. Sampel ini memiliki dua tujuan utama:",
  "MashUpContentProvider_SupplierQualityAnalysisSample_Description2": "Memahami pemasok terbaik dan terburuk, terkait dengan kualitas.",
  "MashUpContentProvider_SupplierQualityAnalysisSample_Description3": "Mengidentifikasi pabrik yang melakukan upaya menemukan dan menolak cacat yang lebih baik, guna meminimalkan waktu henti.",
  "MashUpContentProvider_SupplierQualityAnalysisSample_Title": "Sampel Analisis Kualitas Pemasok",
  "MashUpContentProvider_SweetIQ_Description1": "Lacak dan analisis dengan mudah ekosistem pencarian lokal Anda dengan konektor SweetIQ Power BI. Masuk dengan akun SweetIQ guna meninjau daftar pencarian untuk semua lokasi Anda serta menganalisis dan memantau tinjauan pelanggan. Gunakan dasbor dan laporan yang disediakan, atau ubah untuk menyoroti informasi yang paling penting bagi Anda. Data secara otomatis diperbarui setiap hari dengan yang terbaru dari SweetIQ berdasarkan jadwal yang telah Anda tetapkan.",
  "MashUpContentProvider_SweetIQ_More2": " menyambungkan ke data SweetIQ",
  "MashUpContentProvider_Title": "Penyedia Konten MashUp",
  "MashUpContentProvider_Twilio_Description1": "Memvisualkan data dari akun Twilio Anda secara langsung ke Power BI. Sambungkan dengan kredensial Twilio Anda dan segera dapatkan wawasan dari penggunaan Twillio Anda, seperti panggilan atau pesan Anda dari waktu ke waktu, nomor telepon Twillio Anda yang paling aktif, jumlah pesan dan panggilan yang dikirim dan diterima, dan masih banyak lagi. Dasbor lengkap akan dibuat yang Anda gunakan untuk memantau data Anda serta laporan lengkap untuk jelajahi data lebih dalam.",
  "MashUpContentProvider_Twilio_More2": " menyambungkan ke data Twilio",
  "MashUpContentProvider_UserVoice_Description1": "Pantau dan jelajahi data UserVoice di Power BI cukup dengan menghubungkan ke UserVoice menggunakan kredensial admin Anda. Dengan Power BI, Anda akan memiliki data tiket, saran, dan data kepuasan pengguna langsung di ujung jari Anda. Gunakan dasbor dan laporan yang siap Anda gunakan untuk menganalisis data, mengkustomisasi sesuai keinginan guna menyoroti informasi yang paling penting untuk Anda. Power BI akan menyegarkan data UserVoice setiap hari, sehingga dasbor dan laporan Anda selalu up-to-date.",
  "MashUpContentProvider_UserVoice_More2": " menyambungkan ke data UserVoice",
  "MashUpContentProvider_VisualStudioOnline_Description1": "Visualisasikan aktivitas kode sumber Anda di Power BI dengan menghubungkan ke Microsoft Visual Studio Online. Dasbor dan laporan default memberikan sekilas tampilan git, permintaan tarik, dan kontrol versi di seluruh proyek yang Anda konfigurasi untuk akun. Anda dapat menyesuaikan dasbor dan laporan untuk menyoroti wawasan paling penting bagi Anda.",
  "MashUpContentProvider_VisualStudioOnline_Description2": "Data yang muncul di Power BI akan diperbarui dari Microsoft Visual Studio Online sesuai jadwal yang Anda kontrol.",
  "MashUpContentProvider_VisualStudioOnline_More2": " menghubungkan ke data Visual Studio Online",
  "MashUpContentProvider_WinUserVoice_Description1": "Windows UserVoice dan Windows Phone UserVoice adalah portal saran tempat pengguna Windows dan Windows Phone dapat mengirimkan saran fitur, memberi suara dan/komentar pada saran tersebut, dan didengarkan! Melalui portal, tim rekayasa dapat mengidentifikasi fitur yang inovatif yang didambakan pengguna.",
  "MashUpContentProvider_WinUserVoice_Description2": "Hubungkan ke data organisasi Microsoft dari saran Windows dan Windows Phone UserVoice untuk memperoleh tampilan terbaru dan cepat dari pengguna total, saran total, dan suara total baik untuk Windows UserVoice maupun Windows Phone UserVoice. Anda akan mendapatkan dasbor berisi laporan yang dicadangkan oleh data dari contoh SQL Server Analysis Services internal.  Laporan tersebut menyertakan kategori teratas untuk kedua portal dan tren dalam saran, suara, serta komentar, selama periode tertentu. Anda dapat menyesuaikan dasbor dengan menambahkan metrik yang penting untuk Anda.",
  "MashUpContentProvider_WinUserVoice_Support": "Pertanyaan terkait data dan laporan: winuservoice@microsoft.com",
  "MashUpContentProvider_WinUserVoice_Title": "Windows UserVoice",
  "MashUpContentProvider_Zendesk_Description1": "Analisis data Zendesk Anda di Power BI dengan menyambungkan menggunakan kredensial akun admin Zendesk. Power BI membuat dasbor berisi laporan yang memberikan wawasan tentang kinerja agen dan volume tiket Anda. Gunakan dasbor dan laporan yang diberikan, atau sesuaikan untuk menyorot informasi yang paling Anda minati.",
  "MashUpContentProvider_Zendesk_Description2": "Data Anda di layanan Zendesk akan ditransmisikan ke Power BI sehingga Anda dapat melakukan analisis bisnis. Data ini akan diperbarui setiap hari dari Zendesk sesuai dengan jadwal yang Anda kontrol.",
  "MashUpContentProvider_Zendesk_More2": " menyambungkan ke data Zendesk",
